"""
Common Child (Longest common subsequence (note not substring))
"""
def printMatrix(matrix):
    print("".join(str(row) + "\n" for row in matrix))

def lcs(s1, s2):
    # normalize so s1 always shorter
    if len(s1) > len(s2):
        s1, s2 = s2, s1

    # shorter length to be rows
    print("matrix created start")
    matrix = [[0 for _ in range(len(s2) + 1)] for _ in range(len(s1) + 1)]
    print("matrix created")
    # print(matrix)
    for r in range(1, len(matrix)): # s2
        for c in range(1, len(matrix[0])): #s1
            if s1[r-1] == s2[c-1]:
                matrix[r][c] = matrix[r-1][c-1] + 1
            else:
                matrix[r][c] = max(matrix[r-1][c], matrix[r][c-1])
        # printMatrix(matrix)
    return matrix[len(s1)][len(s2)]


